    reported correctly as an InKind, but the corresponding disbursement of $114.65
    was reported as an operating expenditure rather than an InKind disbursement.  The
    administrative error was corrected during the 2009 Year End reporting period,
    but the original operating expenditure that was reported on the 2009 October Quarterly
    report was never removed/amended causing the Column B cycle totals for Lines 7(a),
    7(c), 17 and 22 to be over by $114.95.  The incorrectly reported operating expenditure
    of $114.65 has been removed and reported correctly on the 2009 October Quarterly.
    \  The cycle totals for the 2009 Year End Report, 2010 April Quarterly, 2010 July
    Quarterly, 2010 October Quarterly and the 2010 Pre-General reports have been amended
    to reflect this change.    2.  The AgriMark PAC also has updated cycle totals
    because the contributions were previously split between two records.\n"
